    return (
      <div>
        <h4 style={{left,position:'absolute'}}>{this.props.cabecera}</h4>
        <h3 style={{textAlign: "center"}}>{this.props.cuerpo}</h3>
      </div>
    );
  }
}

export default Titulo;
